import React from "react";

export const TileList = (props) => {
  const {contacts}= props;
  return (
    <div>
      {
        contacts.map((contact)=>{
          const {name}= contact;
          const description= {name, ...contact};
          <tile
            name= {name}
            description= {description}
          ></tile>
        })
      }
    </div>
  );
};
